fn move_item(&msg) -> Item {
    let mut item = Item {
        id: msg["item_id"].clone(),
        value: msg["value"].clone(),
        owner: msg["to"].clone(),
        permissions: vec!["read", "write"]
    };

    assert_eq!(msg["from"].to_string(), "me".to_string());
    assert_eq!(msg["to"].to_string(), "buddy".to_string());
    assert!(msg["value"].to_string().len() > 0);

    Item {
        id: msg["item_id"].clone(),
        value: msg["value"].clone(),
        owner: msg["from"].clone(),
        permissions: vec!["read"]
    }
}

