import datetime

def calculate_age(birthdate):
    today = datetime.date.today()
    age = today.year - birthdate.year

    if today < datetime.date(today.year, birthdate.month, birthdate.day):
        age -= 1

    return age

def celebrate_birthday(person):
    age = calculate_age(person['birthdate'])
    congratulate = f"Happy {age}th Birthday, {person['name']}!"

    print(congratulate)

