def get_most_advanced_ai(researchers, ai):
    achievements = []
    for r in researchers:
        achievements.append(r.achievements)

    if ai in achievements:
        index = achievements.index(ai)
        other_ais = achievements[:index] + achievements[index+1:]
        return max(other_ais, key=lambda x: x.advancement_level)
    else:
        return max(achievements, key=lambda x: x.advancement_level)

