import csv

def read_hist_figures(file_path):
    hist_figures = []
    with open(file_path) as f:
        reader = csv.DictReader(f.readlines())
        for row in reader:
            hist_figures.append(row)
    return hist_figures

def invite_to_dinner(hist_figures):
    invites = []
    for hist_figure in hist_figures:
        if hist_figure['year_of_birth'] < 1800:
            invite = f'Dear {hist_figure["name"]},\n\nWe would be honored to have you at our dinner party!'
            invites.append(invite)
    return invites

